import { useParams } from "react-router-dom";
import {getApplicantInfo, getJobInfo, getPredictionInfo} from "../json/jsonUtil";
import { Table, TableCell, TableHead, Typography } from "@material-ui/core";
import {Box} from '@material-ui/core';
import React from "react";
import Title from '../components/Title';

export function ReturnApplicantsInfo(){
    return (
        <React.Fragment>
            <Title>All applicants applied to this job</Title>
            <Table>
                <TableHead>
                    <TableRow>
                        <TableCell>Applicant Name</TableCell>
                        <TableCell>% Suitability</TableCell>
                        <TableCell>Skills</TableCell>
                        <TableCell>Applicant Status</TableCell>
                        <TableCell>Change Applicant Status</TableCell>
                    </TableRow>
                </TableHead>
            </Table>
        </React.Fragment>
    )
}
